/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
//                                                                                                                     //
// app/lib/client/methods/sendMessage.js                                                                               //
//                                                                                                                     //
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
                                                                                                                       //
let Meteor;
module.link("meteor/meteor", {
  Meteor(v) {
    Meteor = v;
  }

}, 0);
let TimeSync;
module.link("meteor/mizzao:timesync", {
  TimeSync(v) {
    TimeSync = v;
  }

}, 1);
let s;
module.link("underscore.string", {
  default(v) {
    s = v;
  }

}, 2);
let ChatMessage;
module.link("../../../models", {
  ChatMessage(v) {
    ChatMessage = v;
  }

}, 3);
let settings;
module.link("../../../settings", {
  settings(v) {
    settings = v;
  }

}, 4);
let callbacks;
module.link("../../../../lib/callbacks", {
  callbacks(v) {
    callbacks = v;
  }

}, 5);
let t;
module.link("../../../utils/client", {
  t(v) {
    t = v;
  }

}, 6);
